#include <stdio.h>
#include <time.h>

// Funcție pentru a găsi valoarea maximă dintr-un tablou
int getMax(int arr[], int n) {
    int max = arr[0];
    for (int i = 1; i < n; i++) {
        if (arr[i] > max) {
            max = arr[i];
        }
    }
    return max;
}

// Funcție pentru a implementa algoritmul de sortare radix
void radixSort(int arr[], int n) {
    int max = getMax(arr, n);

    // Se sortează elementele folosind fiecare cifră
    for (int exp = 1; max / exp > 0; exp *= 10) {
        int output[n];
        int count[10] = {0};

        // Se numără frecvența apariției fiecărei cifre
        for (int i = 0; i < n; i++) {
            count[(arr[i] / exp) % 10]++;
        }

        // Se calculează pozițiile reale ale cifrelor în tablou
        for (int i = 1; i < 10; i++) {
            count[i] += count[i - 1];
        }

        // Se construiește tabloul sortat
        for (int i = n - 1; i >= 0; i--) {
            output[count[(arr[i] / exp) % 10] - 1] = arr[i];
            count[(arr[i] / exp) % 10]--;
        }

        // Se copiază elementele din tabloul intermediar în tabloul original
        for (int i = 0; i < n; i++) {
            arr[i] = output[i];
        }
    }
}

// Funcție pentru a construi un heap maxim
void maxHeapify(int arr[], int n, int i) {
    int largest = i; // Se presupune că rădăcina este cea mai mare
    int left = 2 * i + 1;
    int right = 2 * i + 2;

    // Dacă fiul stâng este mai mare decât rădăcina
    if (left < n && arr[left] > arr[largest])
        largest = left;

    // Dacă fiul drept este mai mare decât rădăcina
    if (right < n && arr[right] > arr[largest])
        largest = right;

    // Dacă rădăcina nu este cea mai mare, se face interschimbarea
    if (largest != i) {
        int temp = arr[i];
        arr[i] = arr[largest];
        arr[largest] = temp;

        // Se reapelează funcția pentru subarborele modificat
        maxHeapify(arr, n, largest);
    }
}

// Funcție pentru implementarea algoritmului de sortare prin metoda heap-ului
void heapSort(int arr[], int n) {
    // Construirea heap-ului (rearanjarea tabloului)
    for (int i = n / 2 - 1; i >= 0; i--)
        maxHeapify(arr, n, i);

    // Extragem unul câte unul elementele din heap
    for (int i = n - 1; i >= 0; i--) {
        // Mutăm rădăcina la sfârșitul tabloului
        int temp = arr[0];
        arr[0] = arr[i];
        arr[i] = temp;

        // Apelăm maxHeapify pe heap-ul redus
        maxHeapify(arr, i, 0);
    }
}


// Funcție pentru interclasarea a două subtablouri
void merge(int arr[], int left, int mid, int right) {
    int i, j, k;
    int n1 = mid - left + 1;
    int n2 = right - mid;

    // Crearea subtablourilor temporare
    int L[n1], R[n2];

    // Copierea datelor în subtablouri
    for (i = 0; i < n1; i++)
        L[i] = arr[left + i];
    for (j = 0; j < n2; j++)
        R[j] = arr[mid + 1 + j];

    // Interclasarea subtablourilor temporare în tabloul principal
    i = 0;
    j = 0;
    k = left;
    while (i < n1 && j < n2) {
        if (L[i] <= R[j]) {
            arr[k] = L[i];
            i++;
        } else {
            arr[k] = R[j];
            j++;
        }
        k++;
    }

    // Copierea elementelor rămase din subtabloul L (dacă există)
    while (i < n1) {
        arr[k] = L[i];
        i++;
        k++;
    }

    // Copierea elementelor rămase din subtabloul R (dacă există)
    while (j < n2) {
        arr[k] = R[j];
        j++;
        k++;
    }
}

// Funcție pentru implementarea algoritmului de sortare prin metoda interclasării
void mergeSort(int arr[], int left, int right) {
    if (left < right) {
        int mid = left + (right - left) / 2;

        // Sortarea primei jumătăți și a celei de-a doua jumătăți
        mergeSort(arr, left, mid);
        mergeSort(arr, mid + 1, right);

        // Interclasarea celor două jumătăți sortate
        merge(arr, left, mid, right);
    }
}

void swap(int* a, int* b) {
    int temp = *a;
    *a = *b;
    *b = temp;
}

// Funcție care găsește poziția corectă a elementului pivot în sub-tabloul sortat
int partition(int arr[], int low, int high) {
    int pivot = arr[high]; // Se alege ultimul element ca pivot
    int i = (low - 1); // Indexul elementului mai mic

    for (int j = low; j <= high - 1; j++) {
        // Dacă elementul curent este mai mic sau egal cu pivotul
        if (arr[j] <= pivot) {
            i++; // Se incrementează indexul elementului mai mic
            swap(&arr[i], &arr[j]);
        }
    }
    swap(&arr[i + 1], &arr[high]);
    return (i + 1);
}

// Funcție pentru implementarea algoritmului de sortare rapidă
void quickSort(int arr[], int low, int high) {
    if (low < high) {
        // Se găsește poziția pivotului și se sortează sub-tabloul stâng și cel drept
        int pi = partition(arr, low, high);
        quickSort(arr, low, pi - 1);
        quickSort(arr, pi + 1, high);
    }
}

// Algoritmii de sortare prin inserție
void insertionSort(int arr[], int n) {
    int i, key, j;
    for (i = 1; i < n; i++) {
        key = arr[i];
        j = i - 1;

        while (j >= 0 && arr[j] > key) {
            arr[j + 1] = arr[j];
            j = j - 1;
        }
        arr[j + 1] = key;
    }
}
void selectionSort(int arr[], int n) {
    int i, j, min_idx;
    for (i = 0; i < n - 1; i++) {
        min_idx = i;
        for (j = i + 1; j < n; j++) {
            if (arr[j] < arr[min_idx]) {
                min_idx = j;
            }
        }
        int temp = arr[min_idx];
        arr[min_idx] = arr[i];
        arr[i] = temp;
    }
}
void bubbleSort(int arr[], int n) {
    int i, j;
    for (i = 0; i < n - 1; i++) {
        for (j = 0; j < n - i - 1; j++) {
            if (arr[j] > arr[j + 1]) {
                int temp = arr[j];
                arr[j] = arr[j + 1];
                arr[j + 1] = temp;
            }
        }
    }
}
